INSERT INTO `user_notes` (`id`, `uid`, `note`, `addDate`, `invokeid`, `type`, `points`, `status`) VALUES
(24, 'Weston', 'Being disrespectful to server moderators in /c and in Teamspeak, causing issues within Server Moderator team via /c.', '2011-06-05', 'draven', 2, 0, 2),
(29, 'tazz', 'Failed to deal with a situation on the forums. Was spoken to regarding this', '2011-06-25', 'David', 2, 0, 2),
(30, 'greg', 'Excessively flamed a player/ex-admin in the forums. Was suspended for this.', '2011-06-25', 'David', 2, 0, 2),
(34, 'siegel', 'Helped the new admin out with reports, showed him the ropes and gave him advice.', '2011-07-02', 'jesse', 1, 1, 2),
(35, 'siegel', 'Decided to fly around in a hunter ruining a roleplay situation/almost killing people with the blades. Also decided to place fireworks and killing people/one person after being told to not place them and kill people.', '2011-07-07', 'Sammy', 2, 1, 2),
(38, 'tazz', 'I was speaking to someone in my office, when he randomly entered and started talking. I told him that I was talking to someone and not to just enter whenever he likes and he gave me the excuse \"He is my buddy\". I moved him out of the channel and he came back in and did exactly the same thing. I continued to kick him and he did the same thing and I asked him what he thought he was doing and he replied \"He is my buddy\". I then kicked him one last time and he stopped coming back in. He messaged \"fucker\" to me.', '2011-07-10', 'Devante', 2, 1, 2),
(50, 'infi[d]el', 'Writing in false CMS refunds and providing false links. His CMS account has been suspended until further notice.', '2011-08-14', 'duquesne', 2, 1, 2),
(70, 'Jack', 'Approving a staff banned player for SM', '2011-09-05', '16', 2, 1, 2),
(55, 'russell', 'Failed to respond to a staff complaint in a timely manner', '2011-09-05', 'David', 2, -1, 2),
(96, 'Skoal', 'From 10/23/11: Countless hours spent on reports and shop orders, over 110 reports completed', '2011-11-08', 'Chris!', 1, 1, 2),
(60, 'courtney', 'Failure to fill out the security profiles form after two weeks of given time. The admins were notified twice in two separate posts to fill it out by August 20 or an infraction will be delivered.', '2011-08-23', 'duquesne', 2, 1, 2),
(64, 'Charlie', 'Punishing players for reasons outside of our server offenses/failure to use \"concise uniform reasons for punishments\".\r\n\r\nExamples:\r\nYou were asked to leave the frequency. Quit trolling\r\nStupid, silly noob deathmatc\r\n\r\nHe\'s generally a productive admin yet I constantly have to tell him to only prison for uniform server offenses. I\'ve warned him repeatedly to only prison for legitimate server offenses but he apparently forgets every night.', '2011-08-31', 'Gage', 2, -1, 2),
(65, 'konrad', 'Failure to respond to ban appeal within a standard amount of time under normal circumstances.', '2011-08-31', 'Gage', 2, -1, 2),
